import Layout from "../components/layout";

const Index = () => (
  <Layout>
    <div>
      <h1>Welcome to corona testing</h1>
      <br/>
      <p>To begin testing click "Test Now" in the navbar.</p>
    </div>
  </Layout>
);

export default Index;
